public class Solution {
    public String minWindow(String s, String t) {
        HashMap<Character, Integer> char2cntT = new HashMap<Character, Integer>();
        for(int i = 0; i < t.length(); i++) {
            char c = t.charAt(i);
            if(char2cntT.containsKey(c)) {
                char2cntT.put(c, char2cntT.get(c) + 1);
            } else {
                char2cntT.put(c, 1);
            }
        }
        
        int min = s.length() + 1;
        String res = "";
        for(int i = 0; i < s.length(); i++) {
            char c = s.charAt(i);
            if(!char2cntT.containsKey(c)) {
                continue;
            }
            int j = findLast(s, (HashMap<Character, Integer>)char2cntT.clone(), i);
            if(j != -1 && min > j - i + 1) {
                min = j-i+1;
                res = s.substring(i, j+1);
            }
        }
        return res;
    }
    
    private int findLast(String s, HashMap<Character, Integer> char2cnt, int i) { 
        for(int j = i; j < s.length(); j++) {
            char c = s.charAt(i);
            if(char2cnt.containsKey(c)) {
                int cnt = char2cnt.get(c);
                if(cnt == 1) {
                    char2cnt.remove(c);
                    if(char2cnt.isEmpty()){
                        return j;
                    }
                } else {
                    char2cnt.put(c, cnt-1);
                }
            }
        }
        return -1;
    }
}

